const Introduce = () => {
    return (
        <div id="Introduce">
            <style>{`
                 .hbs *,.hbs *:before,.hbs *:after{background:transparent!important;color:#000!important;box-shadow:none!important;text-shadow:none!important;}
                 .hbs *{-webkit-box-sizing:border-box;-moz-box-sizing:border-box;box-sizing:border-box;}
                 .hbs *:before,.hbs *:after{-webkit-box-sizing:border-box;-moz-box-sizing:border-box;box-sizing:border-box;}
                 ::selection{background:#2d9b00;color:#fff;}
                 ::-moz-selection{background:#2d9b00;color:#fff;}
                 .hzi-font{font-family:'Houzz-Glyphs'!important;speak:none;font-style:normal;font-weight:normal;font-variant:normal;text-transform:none;line-height:1;-webkit-font-smoothing:antialiased;-moz-osx-font-smoothing:grayscale;display:inline-block;*display:inline;zoom:1;vertical-align:middle;font-size:1.5em;}
                 .hzi-Findideas:before{content:"\e95b";}
                 .hp-visitor-block .hp-visitor-block-item__icon{width:104px;height:75px;font-size:104px;color:#888;}
                 @font-face{font-family:'Houzz-Glyphs';src:url('https://st.hzcdn.com/res/4166/pic/fonts/Houzz-Glyphs.eot?NOQWAC');src:url('https://st.hzcdn.com/res/4166/pic/fonts/Houzz-Glyphs.eot#iefixNOQWAC') format('embedded-opentype'), url('https://st.hzcdn.com/res/4166/pic/fonts/Houzz-Glyphs.woff2?NOQWAC') format('woff2'), url('https://st.hzcdn.com/res/4166/pic/fonts/Houzz-Glyphs.woff?NOQWAC') format('woff'), url('https://st.hzcdn.com/res/4166/pic/fonts/Houzz-Glyphs.ttf?NOQWAC') format('truetype'), url('https://st.hzcdn.com/res/4166/pic/fonts/Houzz-Glyphs.svg?NOQWAC#Houzz-Glyphs') format('svg');font-weight:normal;font-style:normal;}

            `}</style>
            <h1>Create the home you've always wanted</h1>
            <div>
                <div>
                    <span class="hp-visitor-block-item__icon hzi-font hzi-Findideas"></span>                
                </div>
                <div>

                </div>
                <div>

                </div>

            </div>
        </div>
    )
}

export default Introduce;
